import React from 'react'
import { MenuList } from './MenuList' 
import MenuItem from '../components/MenuItem'

function Menu() {
  return (
    <div className='menu'>
      <h1 className='menuTitle'>Our Menu</h1>
      <div className='menuList'>{MenuList}
      {MenuList.map((menuItem, key) =>{
        return<MenuItem key={key} image={menuItem.image} name={menuItem.name} ingredients={menuItem.ingredients} price={menuItem.price}/>
      })

      } </div>
    </div>
  )
}

export default Menu
